      "tags_section": null,
      "ntokens": 17,
      "text": "26. Bey Hrn. Rudolf Ramsperger an der Huths gaff ist extra guter Holländer Taback in bleuers nen Pfund Büchsen à 10 Batzen, wie auch guter St. Vincent à 8 Bz. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "27. Wo gute alte große Bohnen zum Sezen, und kleine weiße Bito zum Kochen in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 25,
      "text": "28. Zween Barrellein oder Professor Huth, wie auch ein ganz neuer Caistor Huth, mit unläßiger Größe, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "29. Bey Hrn. Burkhardt zum Riesen sind extra neue große Italienische Feigen, bito große Meerträuben mit und ohne Stiel, Haselnuß, Birne, Morcheln, feine Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 14,
      "text": "30. Zwölf Sack neuer Waizen in billigem Preis, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 31,
      "text": "31. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: 1) Ein Kriegs Atlas von 65 theils Land Karten, Stäben, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Nuß mit Kupfern. 3) Die Durchlauchige Welt, 4 Theil mit Kupfern. 4) Journal du Camp de Compiègne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "32. Sieben laubere frantzösische Bether in ein Wirthshaus auf das Land oder in ein Bad diennlich, ohnentgeltlich in Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 27,
      "text": "33. Ein Behaußung in der Reßchenden Vorstadt mit 4 Stuben, 5 Kammern samt einer schönen großen Keller und Garten, weßhalb sich bey Hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 27,
      "text": "34. Ein Freund, welcher circa 600 Sefter Hanf Saamen andere leisten könte, möchte aber folchen vorhero verkauffen wissen, offerier selbigen dahero in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "35. Wo guter alter weißer Wein zu haben, ist bey Mitr. Michael Fuchs dem Küfer zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "36. Circa 6. Saumt circa guter alter rother Pfeiffer Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "37. Zween Stücklein weißen Wein von 1760, à 8 Pfund to ist der Saum im einen, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 22,
      "text": "38. Ein Stock Heu ab 3 Tannen Matten vorne Richwemer, Thor oberhalb der Schorenbrunnen, ferner ein Stücklein von 37 Saumen rothes Hölzerner Wein von 1760, schon roth und lauter, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 15,
      "text": "39. Auf E. E. Zunft zum Bären sind wiederum in billigem Preis zu haben: neue saure Rüben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "40. Ein roth Scharlachen Camisol und Hofen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 15,
      "text": "41. Im Offenburger Hof ist wöchentlicher Ball zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "42. Ein Brennhaußlein bey der Steinen Mühlin mit aller Kommodität, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 25,
      "text": "43. Bey wemme rother und weißer Burgunder, wie auch Muscat, Wein, Piecenweis, weis Mangel Piazes, wie auch roth und weißer 7säzger Margraffer Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 21,
      "text": "44. Feine heitergelbe Hamburger Strick Wolle das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 25,
      "text": "45. Herrn Holzach des Siegfrists Behaußung ins Spiegelgäßlein mit 4 Stuben, 3 Kammern, ist entweder zu verkauffen, oder samt dem Haus zu verlehnen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "46. Weiße und rothe Margraffer Weine von 1760, wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "47. Ein Mannsbild in St. Peter Kirch auf dem Letner. Item ein grün Tombau, Beyllein mit grünen wellenen Umhängen, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 19,
      "text": "48. Ein Haußschlitten mit einem schönen Bild und Zugehör in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 22,
      "text": "49. Der Bärenfellser Hof zu St. Peter, mit Garten, Stallung, Keller, ist wie der Augen schein zeiget wird. In Ermangelung eines Käuffers"
    }
  ]
}
